import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';

import Home from './Home';

const App = () => {
  return(
    <BrowserRouter>
      <div>
        <Route path="/" exact component={HomePage} />
      </div>
    </BrowserRouter>
  );
}

export default App;
